import React from 'react';
import { Repeat, Heart, MessageCircle } from 'react-feather';

const InteractionIcon = ({ type, ...props }) => {
  switch (type) {
    case 'like':
      return <Heart {...props} />;
    case 'retweet':
      return <Repeat {...props} />;
    case 'reply':
      return <MessageCircle {...props} />;
    default:
      return null;
  }
};

export default InteractionIcon;
